import React from 'react';
import './Navbar.css';

const Navbar = ({ title, url, onClick }) => {
  return (
    <div className="navbar">
      <h2 className="title" onClick={() => onClick(url)}>{title}</h2>
    </div>
  );
};

export default Navbar;
